"use strict";
class DevicesCommand {
    constructor($stringParameter, $emulatorPlatformService, $options) {
        this.$stringParameter = $stringParameter;
        this.$emulatorPlatformService = $emulatorPlatformService;
        this.$options = $options;
        this.allowedParameters = [this.$stringParameter];
    }
    execute(args) {
        if (this.$options.availableDevices) {
            return this.$emulatorPlatformService.listAvailableEmulators(args[0]);
        }
        return $injector.resolveCommand("device").execute(args);
    }
}
exports.DevicesCommand = DevicesCommand;
$injector.registerCommand("devices", DevicesCommand);
